script: |
  super -f text -I q4432.spq | sort > q4432.out

inputs:
  - name: q4432.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 * - ( - col0 ) BETWEEN - + 31 + - 91 * + - 46 * col0 AND + 61;
  - name: tab0

outputs:
  - name: q4432.out
    data: |
      15	81	47
      87	21	10
      97	1	99
